import './App.css';
// import Image from './images/image8.png';

function App() {
  return (
    <div className="App">
      <div className="bar">mogu</div>
      <div className="image-container">
        <img src={MyImage} alt="Description" />
      </div>
      <div>인하대학교 IVC 소속 스타트엄 팀 모구입니다</div>
    </div>
  );
}

export default App;
